'use strict';
let RakeOutCommand = require('./RakeOutCommand.js');
//@@DocBrief("The command for sending 'keep alive' message")
class RakeOutPricesCommand extends RakeOutCommand {
    priceTerminal;
    constructor() {
        super();
        this.priceTerminal = null;
    }
    getCommandName() {
        return "RakeOutPricesCommand(" + this.priceTerminal.getSubId() + ")";
    }
    getTransportMessage() {
        return this.messageFactory.createRakeOutPricesRequestMessage(this.session, this.priceTerminal, this.stikingTime, this.requestNumberGenerator);
    }
}
module.exports = RakeOutPricesCommand
